import React, { Component } from "react";

export default class About extends Component {
  state = {
    userName: "mahmoud",
    lastName: "kadry",
    job: "idk",
    age: "26",
    productList: [
      { pName: "xaiomi", pPrice: 3000, pCat: "mobile" },
      { pName: "apple", pPrice: 35000, pCat: "mobile" },
      { pName: "samsung", pPrice: 45000, pCat: "mobile" },
    ],
  };
  render() {
    return (
      <>
        <div className="container">
          {this.state.productList.map((product) => {
            return (
              <>
                
                  <div class="card text-start col-md-3">
                    <div class="card-body">
                      <h2>{product.pName}</h2>
                      <h2>{product.pPrice}</h2>
                      <h2>{product.pCat}</h2>
                    </div>
                  </div>
                
              </>
            );
          })}
        </div>
      </>
    );
  }
}
